  getToday(dir) {
    let date = new Date();
    let start = date.toISOString().toString().substring(0,10);
    let date2 = new  Date();
    date2.setDate(date.getDate() + 1);
    let end = date2.toISOString().toString().substring(0,10);

    let param = {};
    let headers = {};
    let url = "http://rest.transdep.mn:7879/GeregeTest/Web_service.asmx/get_Date_by_Dispatchers?id_direction=" + dir + "&start=" + start + "&end=" + end;
    return this.http.get(url, {}, {});
  }

  getWeek(dir) {
    let date = new Date();
    let start = date.toISOString().toString().substring(0,10);
    let date2 = new  Date();
    date2.setDate(date.getDate() + 7);
    let end = date2.toISOString().toString().substring(0,10);
    let param = {};
    let headers = {};
    let url = "http://rest.transdep.mn:7879/GeregeTest/Web_service.asmx/get_Date_by_Dispatchers?id_direction=" + dir + "&start=" + start + "&end=" + end;
    return this.http.get(url, {}, {});
  }

  xmlToJson(xml) {
	
    var obj = {};
  
    if (xml.nodeType == 1) { // element
      // do attributes
      if (xml.attributes.length > 0) {
      obj["@attributes"] = {};
        for (var j = 0; j < xml.attributes.length; j++) {
          var attribute = xml.attributes.item(j);
          obj["@attributes"][attribute.nodeName] = attribute.nodeValue;
        }
      }
    } else if (xml.nodeType == 3) { // text
      obj = xml.nodeValue;
    }
  
    // do children
    if (xml.hasChildNodes()) {
      for(var i = 0; i < xml.childNodes.length; i++) {
        var item = xml.childNodes.item(i);
        var nodeName = item.nodeName;
        if (typeof(obj[nodeName]) == "undefined") {
          obj[nodeName] = this.xmlToJson(item);
        } else {
          if (typeof(obj[nodeName].push) == "undefined") {
            var old = obj[nodeName];
            obj[nodeName] = [];
            obj[nodeName].push(old);
          }
          obj[nodeName].push(this.xmlToJson(item));
        }
      }
    }
    return obj;
  };

  getTodayTimeTable(dir) {
    let result;
    return this.getToday(dir).then(data => {
      return new Promise((resolve, reject) => {
        resolve(result.diffgram.DocumentElement);
      });
    });
  }

  getWeekTimeTable(dir) {
    let result;
    return this.getToday(dir).then(data => {
      return new Promise((resolve, reject) => {
        resolve(result.diffgram.DocumentElement);
      });
    });
  }

